  true,\n\t\"url\": null,\n\t\"notes\": \"This project focused on defining geothermal
  play fairways and development of a detailed geothermal potential map of a large
  transect across the Great Basin region (96,000 km2), with the primary objective
  of facilitating discovery of commercial-grade, blind geothermal fields (i.e. systems
  with no surface hot springs or fumaroles) and thereby accelerating geothermal development
  in this promising region. Data included in this submission consists of: structural
  settings (target areas, recency of faulting, slip and dilation potential, slip rates,
  quality), regional-scale strain rates, earthquake density and magnitude, gravity
  data, temperature at 3 km depth, permeability models, favorability models, degree
  of exploration and exploration opportunities, data from springs and wells, transmission
  lines and wilderness areas, and published maps and theses for the Nevada Play Fairway
  area. \",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
